const Kisi = (prop) => {
  return (
    <div>
      <h1>{prop.ad}</h1>  
      <img src={prop.img} alt="" width={100}/>
      <h4>{prop.yas}</h4>
      <h4>{prop.kurs}</h4>





    </div>
  )
}

export default Kisi
